import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Link} from 'react-router-dom';
import '../style/Main.css'
export default function SimpleContainer() {
    const[id,setId]=useState('');
    const[name,setName]=useState("");
    const[roll,setRoll]=useState();
    const[address,setAddress]=useState("");
    const[age,setAge]=useState();
    const[department,setDepartment]=useState();
    async function save(event) {
        event.preventDefault();
        try {
            await axios.post("http://localhost:8989/saveStudent",
                {

                    name: name,
                    address: address,
                    roll:roll

                });
            alert("Student Registation Successfully");
            setName("");
            setAddress("");
            setRoll();


        }
        catch (err) {
            alert("User Registation Failed");
        }
    }

    return (
        <div>

            <form id="login-form">
                <label for="username">Username:</label>
                <input type="text" id="username" name="username" required/>
                        <label for="password">Rollnumber:</label>
                        <input type="password" id="password" name="password" required/>
                <label for="username">Department:</label>
                <input type="text" id="username" name="username" required />
                <label for="username">Age:</label>
                <input type="text" id="username" name="username" required />
                <label for="password">Address:</label>
                <input type="password" id="password" name="password" required />

                <button type="submit" class="btn btn-secondary" onClick={save}>Submit</button>
                &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                <Link to='/Main'>
                    <button type="submit" class="btn btn-primary">Back</button></Link>
                            </form>

        </div>
    );
}
